import React, { FC, ReactElement } from "react";


export const LogInForm: FC = (): ReactElement => {
  return (
    <form>
    <label>
      Firtame:
      <input type="text" name="name" />
    </label>
    <label>
      Name:
      <input type="text" name="name" />
    </label>
    <input type="submit" value="Submit" />
  </form> 
  );
};

export default LogInForm;
